// NavigationBar.js
import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Navigationbar.module.css';




function NavigationBar() {
  return (
    <nav className={styles.nav}>
      <ul>
        <li>
          <Link to="/" exact className={styles.navLink} activeClassName={styles.activeLink}>
            Home
          </Link>
        </li>
        <li>
          <Link to="/RizikoveFaktory" className={styles.navLink} activeClassName={styles.activeLink}>
            Rizikov√© Faktory
          </Link>
        </li>
        <li>
          <Link to="/Dotaznik" className={styles.navLink} activeClassName={styles.activeLink}>
            Dotaznik
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default NavigationBar;
